export default function Navbar() {
  const path = window.location.pathname
    return (
      <nav className="nav">
        <a href="/" className="site-title">
          Site Name
        </a>
        <ul>
          <a href="/one">One</a>
          <a href="/two">Two</a>
          <a href="/three">Three</a>
        </ul>
      </nav>
    )
  }

  function CustomLink(href, children, ...props){
    <li>
      <a href={href}>{children}</a>
    </li>
  }
